import React from 'react'
import './Header.css'

const Header = () => {
    return (
        <div className="header">
            <h1>Blog de Viajes Corona, Nueva York</h1>
            <p>explora esta pueblo en Queens conmigo</p>
            <p>Bienvenidos, yo soy Erica. Este es mi proyecto para la clase de español 1101 Español Proyecto. Vivo en Queens, Nueva York. Queens tiene muchas comunidades. Astoria, Jackson Heights, Long Island City y Sunnyside están en el noroeste de Queens. Bayside, Bellerose, College Point, Little Neck, Flushing, Pomonok, Floral Park, Fresh Meadows, Glen Oaks y Whitestone están el noreste de Queens. Briarwood, Corona, LeFrak City (una urbanización), North Corona, East Elmhurst, Elmhurst, Forest Hills, Forest Hills Gardens, Fresh Pond, Glendale, Jackson Heights, Kew Gardens, Maspeth, Middle Village, Rego Park, Ridgewood, Wyckoff Heights y Woodside están el centro de Queens. Mi proyecto es sobre Corona, Queens. Corona, Queens tiene una historia única. Esta ciudad tiene el mismo nombre que Crown Building Company. Queens tiene dos millones dos mil doce trescientos sesenta (2,212,360) personas en 2019.
</p>
        </div>
    )
}

export default Header // important if we want to use header.js in other files
